(157, 19, 38, 'Prodi tidak mengetahui jumlah calon mahasiswa yang ikut seleksi, sehingga rasio calon mahasiswa dan daya tampung tidak dapat diketahui. Sebaiknya data penerimaan mahasiswa baru disajikan dalam bentuk tabulasi oleh bagian akademik Universitas, dan ditampilkan secara online, jika tidak bagian akademik mengirimkan data tersebut sampai ke program studi. ', 'Data Penerimaan Mahasiswa Baru', '2018-06-01', 30, '2018-01-18 13:34:31', 30, '2018-01-18 13:34:31', 0),
(158, 19, 38, 'Jumlah mahasiswa yang melakukan registrasi kurang dari 95%, padahal jumlah yang lulus seleksi lebih banyak dari kuota yang tersedi untuk prodi teknik Informasi yang hanya 140 orang. Jumlah yang tidak registrasi ulang adalah 16,59%. Kedepannya perlu dicari apa penyebabnya.', 'Penerimaan Mahasiswa Baru', '2018-06-01', 30, '2018-01-18 13:44:53', 30, '2018-01-18 13:44:53', 0),
(159, 19, 38, 'IPK Rata-rata mahasiswa Prodi Teknik Informatika hanya 2,9. Ke depannya prodi harus meninjau/menganalisa input mahasiswa yang akan diterima di Prodi Teknik Informatika, dan metode pembelajaran yang diterapkan oleh dosen.', 'IPK Mahasiswa', '2018-06-01', 30, '2018-01-18 13:50:11', 30, '2018-01-18 13:50:11', 0),
(160, 19, 38, 'Persentase Kelulusan mahasiswa Prodi Teknik Informatika yang tepat Waktu hanya 10%, hal ini terjadi karena banyak mahasiswa yang galau dalam menentukan judul penelitian untuk tugas akhir mereka.  ', 'Data Lulusan', '2018-12-01', 30, '2018-01-18 13:59:26', 30, '2018-01-18 13:59:26', 0),
(161, 19, 38, 'Masa tunggu kerja Pertama lulusan Prodi Teknik Informasi adalah rata-rata enam (6) bulan, hanya 10% di bawah tiga (3) bulan. ', 'Data Alumni', '2018-12-01', 30, '2018-01-18 14:03:18', 30, '2018-01-18 14:03:18', 0),
(162, 19, 38, 'Lulusan Prodi Teknik Informatika hanya 10% yang bekerja sesuai dengan bidang studinya, sisanya bekerja tidak sesuai dengan bidang studi. Hal ini perlu menjadi perhatian bagi prodi ke depannya dengan menyiapkan kemampuan/keahlian lebih bagi mahasiswanya melalui kegiatan-kegiatan tambahan yang diselenggarakan oleh prodi, HMJ.', 'Data Alumni', '2018-12-01', 30, '2018-01-18 14:08:49', 30, '2018-01-18 14:08:49', 0),
(163, 19, 38, 'Dalam Buku Panduan Akademik yang diterbitkan oleh Universitas, matakuliah disetiap program studi tidak dikelompokkan ke dalam kelompokk unsur pengembangan kepribadian, Kelompok keahlian dan Ketrampilan, Kelompok Perilaku dan berkarya serta kelompok kehidupan bermasyarakat, padahal matakuliah yang ada sudah mencakup semua kelompok tersebut. ke depannya diharapkan buku panduan akademik ini dirubah sehingga matakuliah di program studi  dikelompokkan sesuai kategori tersebut ( sesuai dengan standar AMI). ', 'Kurikulum', '2018-06-01', 30, '2018-01-18 14:16:04', 30, '2018-01-18 14:16:04', 0),
(164, 19, 38, 'Pengembangan Matakuliah Kompetensi Keislaman di Prodi Teknik Informatika dilakukan oleh dosen yang berkeahlian islamic studies di fakultas Sain dan Teknologi yang ditempatkan berdasakan SK Rektor, bukan di koordinir oleh Fak. Ushuludin dan Syariah, pada menurut Peraturan Akademik Universitas harus dilakukan oleh Fak. Ushuludin dan Syariah, hal ini menunjukkan adanya ketidaksinkronan kebijakan yang diterapkan. Oleh karena itu, perlu dilakukan peninjaaun kembali atas penempatan dosen islamic studies di Fakultas umum atau merevisi Peraturan akademik', 'Peraturan Akademik', '2018-06-01', 30, '2018-01-18 14:24:58', 30, '2018-01-18 14:24:58', 0),
(165, 19, 38, 'Bobot kerja praktek atau PKL di Prodi teknik informatika hanya 2 sks, bila diperhatikan jumlah waktu yang dihabiskan oleh mahasiswa untuk menyelesaikan PKLnya melebihi dari beban 2 sks, sehingga kedepannya beban sks untuk PKL atau kerja praktek ini harus dinaikkan minimal menjadi 3 sks.', 'Kurikulum', '2018-06-01', 30, '2018-01-18 14:31:03', 30, '2018-01-18 14:31:03', 0),
(166, 19, 38, 'Mahasiswa yang memiliki sertifikat pada level tertentu belum diakui, dan tetap mengambil matakuliah bahasa sesuai dengan panduan akademik.', 'Kurikulum', '2018-06-01', 30, '2018-01-18 14:35:07', 30, '2018-01-18 14:35:07', 0),
(167, 19, 8, 'Program Studi Manajemen Pendidikan Islam terkareditasi A sejak tanggal 27 Oktober 2016-27 Oktober 2021', 'Sertifikat Akreditasi BAN-PT', '2018-01-16', 29, '2018-01-19 04:59:29', 29, '2018-01-19 04:59:29', 0),
(168, 19, 8, 'Program Bahasa dilakukan 3 (tiga) semester', 'Pedoman akademik universitas', '2018-01-16', 29, '2018-01-19 05:15:43', 29, '2018-01-19 05:15:43', 0),
(169, 19, 8, 'Program Studi Manajemen Pendidikan Islam memiliki MK. PPL dengan bobot 4 SKS', 'Panduan Akademik Univeristas TA. 2017/2018', '2018-01-16', 29, '2018-01-19 05:18:02', 29, '2018-01-19 05:18:02', 0),
(170, 19, 42, 'Audit dilakukan berjalan lancar, dan penandatangan laporan audit akan dilakukan sebagai langkah selanjutnya', 'Laporan audit', '2018-01-19', 166, '2018-01-20 08:14:15', 166, '2018-01-20 08:14:15', 0),
(171, 19, 42, 'Yang menjadi temuan hanya pada poin 9, 19, dan 38. Semua temuan ini bersifat observasi, dan segera akan ditindaklanjuti oleg prodi teknik elektro', 'Laporan audit, peraturan akademik, standar borang akreditasi', '2018-01-19', 166, '2018-01-20 08:18:12', 166, '2018-01-20 08:18:12', 0),
(172, 19, 42, 'Pertanyaan no. 13 dijawab oleh prodi \"tidak\". Karena Prodi Teknik elektro untuk persentase kelulusan yang tepat waktu  >=50%', 'Laporan audit', '2018-01-19', 166, '2018-01-20 08:19:51', 166, '2018-01-20 08:19:51', 0),
(173, 19, 42, 'Pertanyaan no. 42 dijawab oleh prodi \"tidak\". Karena Prodi Teknik elektro untuk dosen yang mengajar mata kuliah keagamaan dikoordinir oleh prodi sendiri, karena di prodi elektro ada dosen tetap yang bidang studi nya agama', 'Laporan audit', '2018-01-19', 166, '2018-01-20 08:21:47', 166, '2018-01-20 08:21:47', 0),
(174, 19, 42, 'Pertanyaan no. 45, 49, dan 54 adalah untuk prodi D3, sedangkan auditi adalah prodi S1.', 'Laporan audit', '2018-01-19', 166, '2018-01-20 08:23:21', 166, '2018-01-20 08:23:21', 0);
