(7172, 19, 38, 38, 40, 'Ya', 'buku panduan akademik  ', 'ada 14 sks (studi alquran, studi hadist, aqidah akhlak, fiqih, sejarah peradaban islam, sejarah islam asia tenggara, dengan beban masing-masing 2 sks)', 160, '2018-01-11 08:40:58', 30, '2018-01-15 02:16:53', 0),
(7173, 19, 38, 39, 41, 'Ya', 'buku panduan akademik 2015/2016', 'Matakuliah Aqidah Akhlak diberikan pada semester 1\nMetodologi Studi Islam, Fiqih diberikan pada semester 2\nStudi alquran diberikan pada semester 3\nSejarah peradaban islam diberikan pada semester 4\nStudi Hadis diberikan pada semester 5\nSejarah Islam Asia Tenggara diberikan pada semester 6\n', 160, '2018-01-11 08:40:58', 30, '2018-01-18 14:19:03', 0),
(7174, 19, 38, 40, 42, 'Tidak', NULL, 'Ada dosen yang berkeahlian islamic studies di fakultas Sain dan Teknologi yang ditempatkan berdasakan SK Rektor, sehingga pengembangan MK. islamic studies diberikan kepada dosen-dosen tersebut.', 160, '2018-01-11 08:40:58', 30, '2018-01-15 02:10:20', 0),
(7175, 19, 38, 41, 43, 'Ya', 'buku panduan dan informasi Akademik 2015/2016', 'Mk prakter kerja lapangan di Prodi teknik informatika namanya Mk kerjak praktek', 160, '2018-01-11 08:40:58', 30, '2018-01-15 02:25:14', 0),
(7176, 19, 38, 43, 44, 'Tidak', 'buku panduan dan informasi Akademik 2015/2016', 'bobot kerja praktek di prodi teknik informatika hanya 2 sks', 160, '2018-01-11 08:40:58', 30, '2018-01-15 02:26:01', 0),
(7177, 19, 38, 44, 45, 'Ya', 'Peraturan Akademik tahun ', 'di prodi TIF minimum 80 sks sudah bisa mengikuti prakterk kerja lapangan atau Kerja lapangan, ditambah matakuliah tertentu harus dapat A- (disemester 5), dan Kp dilaksanakan di semester 6', 160, '2018-01-11 08:40:58', 30, '2018-01-15 04:36:32', 0),
(7178, 19, 38, 45, 46, 'Ya', 'buku panduan dan informasi Akademik \nperaturan akademik', 'Dokumen sangat lengkap', 160, '2018-01-11 08:40:58', 30, '2018-01-18 14:33:22', 0),
(7179, 19, 38, 46, 47, 'Tidak', 'buku panduan dan informasi Akademik ', 'tiga semester (semester 1, 2 dan 3) karena ada level I (tingkat dasar), II (menengah), dan III (lanjut).', 160, '2018-01-11 08:40:58', 30, '2018-01-18 14:35:39', 0),
(7180, 19, 38, 47, 48, 'Tidak', 'Buku panduan dan informasi Akademik', 'mahasiswa yang memiliki sertifikat pada level tertentu belum diakui, dan tetap mengambil matakuliah bahasa sesuai dengan panduan akademik.', 160, '2018-01-11 08:40:58', 30, '2018-01-15 02:35:35', 0),
(7181, 19, 38, 48, 49, 'Tidak', 'Peraturan Akademik', 'bukan dalam bentuk sertifikat, tetapi nilai mt.kuliah bahasa inggris', 160, '2018-01-11 08:40:58', 30, '2018-01-15 04:39:23', 0),
(7182, 19, 38, 49, 50, 'Ya', 'Peraturan Akademik', 'bukan dalam bentuk sertifikat, tetapi nilai mt.kuliah bahasa Arab', 160, '2018-01-11 08:40:58', 30, '2018-01-15 04:39:41', 0),
(7183, 19, 38, 50, 51, 'Ya', 'peraturan Akademik \nbuku panduan dan informasi akademik ', 'koding huruf untuk prodi teknik informatika ada PIF', 160, '2018-01-11 08:40:58', 30, '2018-01-15 02:40:32', 0),
