(5, 2, 40, 66, 'Persentase Kelulusan Mahasiswa Prodi Sistem Informasi dibawah 20 %.', 'Standar 3.  Mahasiswa dan Lulusan  butir 3.2.1.2  Persentase kelulusan tepat waktu untuk semua program studi.', 'KTS', 'Program Kerja Praktek (PPL) harus dilakukan Mahasiswa selama 2 Semester dan dilakukan sambil kuliah, sehingga banyak Perusahaan yang tidak mau menerima Mahasiswa magang.', 'Masa studi mahasiswa semakin lama, sehingga tidak bisa lulus tepat waktu.', 'Program Kerja Praktek (PPL) sebaiknya cukup satu semester atau 2 bulan, dan dilakukan setelah habis teori atau pada waktu libur panjang di awal semester.', '', '', '2015-09-25', 'Ketua Prodi', 0, 62, '2015-09-21 10:39:47', 62, '2015-09-27 08:57:04', 0),
