(7, 2, 20, 101, 'syarat munaqasah belum menggunakan toefl ', 'Edaran DIKTI ', 'OB', 'prodi belum menyelenggarakan secara mandiri tes toefl', 'prodi belum bisa mewajibkan lulus untuk menggunakan sertifikat toefl sebagai syarat lulus', 'prodi bekerjasama dengan lembaga bahasa untuk mengadakan tes toefl', 'tes toefl dilakukan hanya sebagai syarat munaqosah. skor toefl tidak menjadi syarat munaqosah.', '', '2015-09-21', 'Nur\'aini Sahu, SH., MH', 1, 40, '2015-09-23 14:20:23', 40, '2015-10-05 16:07:06', 0),
(8, 2, 20, 102, 'syarat munaqasah belum menggunakan toafl', 'edaran DIKTI', 'OB', 'belum adanya kebijakan yang dikeluarkan oleh pihak fakultas untuk menggunakan skor toafl sebagai syarat kelulusan. ', 'mahasiswa tidak memiliki skor TOAFL ketika lulus', 'melakukan tes TOAFL dengan bekerjasama dengan pusat bahasa', '', '', '2015-09-21', 'Nur\'aini Sahu, SH., MH', 1, 40, '2015-09-23 14:21:37', 40, '2015-10-05 16:07:07', 0),
