(17, 2, 41, 110, 'Belum diterapkan SKK ( Sistem Kredit Ko-Kurikuler)', 'SK Rektor Nomor : 035/SK/SU/2015 Tentang Peraturan Akademik UIN Sultan Syarif Kasim Riau', 'OB', 'Tidak diberlakukannya SKK, mengacu pada SK Rektor nomor :035/SK/SU/2015 Tentang Peraturan Akademik ', 'Belum diberlakukannya SKK (Sistem Kredit Ko-Kurikuler)', 'Pelaksanaan SKK (Sistem Kredit Ko-Kurikuler) dengan mengacu pada SK Rektor nomor 35/SK/SU/2015 Tentang Peraturan Akademik', 'Setuju', 'Tahap perbaikan sebagai berikut :\r\n1. Pembahasan di tingkat jurusan atau melalui mekanisme baku/ standar yang adadi Fakultas Sainteks\r\n2.Koordinasi dan konsultasi dengan pihak-pihak terkait\r\n3.Pengambilan keputusan mengenai pemberlakukan SK Rektor  nomor :035/SK/SU/2015 Tentang Peraturan Akademik melalui mekanisme baku/standar yang ada di Jurusan Matematika Fakultas Sainteks dan di UIN Suska Riau', '2016-06-30', 'Ketua Jurusan Matematika Fakultas Sainteks', 1, 31, '2015-09-28 08:04:52', 31, '2015-09-28 01:04:52', 0),
