(73, 2, 15, 71, 'Masa tunggu kerja pertama lulusan tidak memenuhi standar BAN-PT, tetapi tahun ini fakultas sudah menfasilitasi alumni untuk bekerja di PUSBAKUM dan LP2KS yang terdapat di Pekanbaru dan Kampar.', 'BAN-PT', 'OB', 'Adanya waktu tenggang yang cukup panjang antara kelulusan mahasiswa dengan penerimaan tenaga kerja, seperti CPNS.', 'Dengan adanya PUSBAKUM dan LP2KS, maka masa tunggu kerja alumni bisa dipercepat, menjadi di bawah 3 bulan', '- Meningkatkan jumlah dan kualitas kerjasama dengan berbagai pihak terkait atau stakeholder. \r\n- Mengembangkan PUSBAKUM dan LP2KS di kabupaten lain yang ada di Riau', 'Setuju untuk meningkatkan kerjasama dengan stakeholder dan mengembankan PUSBAKUM dan LP2KS', 'Tahun akademik  2015-2016', '2015-09-25', 'Ketua Prodi', 0, 48, '2015-09-25 08:04:06', 48, '2015-09-28 04:12:25', 0),
