(120, 2, 26, 62, 'Rasio calon mahasiswa yang ikut seleksi dibanding dengan daya tampung kurang dari 5', 'BAN PT Standar 3.1.1 Rasio calon mahasiswa yang ikut seleksi:daya tampung', 'OB', 'Terbatasnya dana sosialisasi, sehingga tim sosialisasi tidak dapat mengunjungi sekolah secara menyeluruh', 'sosialisasi prodi tidak dapat dilaksanakan secara maksimal', 'Dekan  memerintahkan kepada  Prodi meningkatkan  Sosialisasi dan promosi Prodi  dengan meningkatkan anggaran untuk sosialisasi sehingga dapat melakukan sosialisasi  langsung ke calon mahasiswa pada saat yang tepat dan dana yang cukup.', 'Setuju', 'Melakukan sosialisasi kepada seluruh Sekolah menengah atas  di Provinsi Riau dan sekitarnya', '2015-01-01', 'Ketua Prodi', 0, 13, '2015-09-28 10:21:19', 13, '2015-09-29 07:44:28', 0),
