(176, 2, 25, 65, 'Prestasi mahasiswa yang pernah diikuti yaitu perlombaan ilmiah ditingkat nasional, olahraga di tingkat lokal PT, dan seni ditingkat nasional. Namun belum ada mengikuti perlonbaan ditingkat regional dan internasional.', 'Standar 3.1.3 BAN PT', 'OB', 'Pembinaan yang belum optimal ditingkat fakultas', 'mahasiswa belum bisa mengaktualisasikan nalar, bakat, dan minat secara optimal.', 'Menjalin kerjasama dengan organisasi yang bergerak dibidang olahraga (seperti POSMA, KONI Riau), mengiatkan mahasiswa untuk  berkarya, menulis karya ilmiah. ', 'Setuju', 'Meningkatkan prestasi mahasiswa dibidang ilmiah, olahraga, dan seni. Dengan meyediakan sarana dan prasarana yang penunjang untuk hal itu.', '2016-05-04', 'Ketua Prodi', 0, 16, '2015-09-28 19:53:54', 16, '2015-09-29 16:57:47', 0),
(177, 2, 24, 89, 'Tidak bisa dihitung proporsi komponen utama, penunjang dan lainnya', 'UIN dan BAN-PT Standar 5.1.1. Kurikulum memuat kompetensi lulusan secara lengkap (utama, pendukung, lainnya) yang terumuskan secara sangat jelas. ', 'OB', 'Tidak ada dalam Panduan Akademik', 'Berpeluang terjadi overload pada salah satu komponen', 'Dekan menginstruksikan prodi segera membuat dan memisahkan komponen mata kuliah berdasarkan komponen inti, penunjang dan lainnya', 'Setuju', 'Berusaha memperbaiki komponen mata kuliah dengan proporsi komponen utama 55-70%, penunjang 20-40% dan lainnya maksimal 30%', '2016-06-01', 'Ketua Prodi', 0, 12, '2015-09-28 20:11:44', 12, '2015-09-29 06:07:19', 0),
(178, 2, 25, 66, 'Jurusan belum merekap data mengenai kelulusan mahasiswanya yang tepat waktu', 'Standar 3.1.4.a BAN PT', 'OB', 'Jurusan belum mengetahui bahwasanya rekap dat mengenai kelulusan mahasiswa yang tepat waktu itu penting untuk dilakukan.', 'Jurusan tidak dapat mengetahui besaran persentase mahasiswanya yang tepat waktu dalam studinya.', 'Perlu dibuat rekapitulasi perkembangan jumlah mahasiswa per angkatan per tahun.', 'Setuju', 'Merekap perkembangan mahasiswa per angkatan per tahun.', '2016-06-01', 'Ketua Prodi', 0, 16, '2015-09-28 20:35:04', 16, '2015-09-28 14:30:14', 0),
(179, 2, 25, 67, 'Mahasiswa yang DO di Ilmu komunikasi disebabkan oleh perkuliahan mahasiswa  yang bersangkutan sudah melebihi 14 semester, dan tidak membayar SPP 4 semester berturut-turut, sedangkan yang mengundurkan diri tidak diketahui penyebab pastinya dari mahasiswa yang bersangkutan. Namun data jumlah berapa yang DO tidak dapat diketahui.', 'Standar 3.1.4.b BAN PT', 'OB', '- Jurusan tidak membuat arsip untuk kategori ini.\r\n- Jurusan tidak bisa dapat mengakses data (iraise) dari bagian Akademik rektorat.', 'Jurusan tidak mengetahui jumlah dan mengidentifikasi mahasiswa yang DO atau mengundurkan diri', '- Meminta Admin iraise membuka akses untuk jurusan\r\n- Tenaga admin fakultas harus merekap data mahasiswa yang DO atau mengundurkan diri, serta mengidentifikasi penyebab-penyebabnya.\r\n\r\n-', 'Setuju', '- Meminta admin akademik rektorat membuka akses k untuk jurusan.\r\n-  Meminta tenaga admin fakultas merekap data mahsiswa yang DO atau mengundurkan diri\r\n- Mengoptimalkan peran PA sebagai dosen konsultasi bagi mahasiswa.', '2015-11-01', 'Ketua Prodi', 0, 16, '2015-09-28 20:52:45', 16, '2015-09-28 14:29:35', 0),
(180, 2, 24, 106, 'Beban studi mahasiswa semester V keatas sebesar 154 SKS tidak sesuai standar kurikulum KKNI', 'Ketentuan UIN', 'OB', 'Belum menerapkan standar kurikulum KKNI', 'Bisa terjadi overload SKS dalam mata kuliah', 'Dekan menginstruksikan prodi segera memperbaiki beban studi mahasiswa agar sesuai standar kurikulum KKNI', 'Setuju', 'Prodi merevisi kurikulum untuk menetapkan beban studi sesuai standar kurikulum KKNI antara 144-150 untuk S1 ', '2016-06-01', 'Ketua Prodi', 0, 12, '2015-09-28 20:57:22', 12, '2015-09-29 06:27:20', 0),
(181, 2, 24, 110, 'Tidak ada dosen bina Sistem Kredit Ko-Kurikuler (SKK)', 'Ketentuan UIN', 'OB', 'Prodi belum menerapkan SKK', 'Tidak memiliki dosen bina SKK', 'Dekan menginstruksikan prodi segera membentuk dosen bina SKK', 'Setuju', 'Prodi mulai menentukan dosen yang akan membina Sistem Kredit Ko-Kurikuler (SKK)', '2016-02-01', 'Ketua Prodi', 0, 12, '2015-09-28 21:11:17', 12, '2015-09-29 06:36:14', 0),
(182, 2, 24, 111, 'Tidak ada nilai SKK', 'Ketentuan UIN', 'OB', 'Belum melaksanakan SKK ', 'Mahasiswa tidak memiliki nilai SKK', 'Dekan menginstruksikan prodi segera melaksanakan SKK', 'Setuju', 'Prodi mulai menyegerakan untuk melaksanakan SKK pada semester depan. Kriterianya nilai SKK didasarkan bukti kegiatan', '2016-02-01', 'Ketua Prodi', 0, 12, '2015-09-28 21:15:28', 12, '2015-09-29 06:40:18', 0),
(183, 2, 25, 69, 'Pihak akademik membuat  website untuk melacak dan merekam data alumni dan  sudah menyediakan formulirnya yang harus diisi oleh alumni, akan tetapi belum dapat dilacak. Selain itu jurusan bersama alumni juga membuat group alumni.', 'Standar 3.3.1.a BAN PT', 'OB', 'Sistem dibuat oleh universitas, dan belum dapat diakses oleh jurusan.', 'Jurusan tidak bisa melacak lulusannya.', 'Berkoordinasi dengan pihak akademik rektorat \r\n', 'setuju', 'Berkoordinasi segera dengan pihak akademik rektorat.\r\n', '2015-11-09', 'Ketua Prodi', 0, 16, '2015-09-28 21:16:50', 16, '2015-09-28 15:49:38', 0),
(184, 2, 24, 112, 'Tidak ada transkip SKK dikeluarkan dekan', 'Ketentuan UIN', 'OB', 'Belum melaksankan SKK', 'Mahasiswa tidak memiliki transkip SKK', 'Dekan menginstruksikan prodi segera melaksanakan SKK', 'Setuju', 'Prodi mempersiapkan transkip SKK dikeluarkan dekan', '2016-02-01', 'Ketua Prodi', 0, 12, '2015-09-28 21:17:27', 12, '2015-09-29 06:41:43', 0),
(185, 2, 24, 113, 'Tidak ada laporan SKK dosen diteruskan pada Dekan', 'Ketentuan UIN', 'OB', 'SKK belum dilaksanakan', 'Tidak ada laporan SKK dosen', 'Dekan menginstruksikan prodi agar segera melaksanakan SKK', 'Setuju', 'Prodi membuat form Laporan SKK dosen yang diteruskan pada Dekan', '2016-02-01', 'Ketua Prodi', 0, 12, '2015-09-28 21:28:44', 12, '2015-09-29 07:03:01', 0),
(186, 2, 24, 114, 'Tidak ada evaluasi laporan SKK dosen dan penilaian mahasiswa yang dilakukan ka-prodi', 'Ketentuan UIN', 'OB', 'SKK belum dilaksanakan', 'Validitas laporan SKK diragukan', 'Dekan menginstruksikan prodi agar segera melaksanakan SKK', 'Setuju', 'Prodi mempersiapkan materi untuk  melakukan evaluasi laporan SKK dosen dan penilaian mahasiswa', '2016-03-15', 'Ketua Prodi', 0, 12, '2015-09-28 21:33:41', 12, '2015-09-29 06:45:29', 0),
(187, 2, 24, 115, 'Rasio dosen tetap S2 dan S3 yang bidang keahliannya sesuai dengan kompetensi PS dibawah kriteria', 'BAN-PT Standar 4.3.1.a  Dosen tetap berpendidikan (terakhir) S2 dan S3 yang bidang keahliannya sesuai dengan kompetensi PS ', 'OB', 'Jumlah dosen tetap berpendidikan S2 dan S3 kurang', 'Dosen yang mengajar tidak sesuai dengan kompetensi yang dimilikinya', 'Dekan menginstruksikan agar prodi segera memposisikan  dosen tetap yang bidang keahliannya sesuai dengan kompetensi Program Studi', 'Setuju', 'Mengklasifikasikan  dosen tetap berpendidikan (terakhir) S2 dan S3 yang bidang keahliannya sesuai dengan kompetensi Program Studi. Kriteria harus sama besar atau lebih dari 90% ', '2016-06-01', 'Ketua Prodi', 0, 12, '2015-09-28 21:45:34', 12, '2015-09-29 06:54:17', 0),
(188, 2, 25, 70, 'Website yang dibuat oleh universitas tidak bisa dilacak oleh jurusan. sedangkan pelacakan melalui group di FB sudah ada akan tetapi belum memuat informasi secara lengkap sehingga belum dapat digunakan untuk perbaikan proses pembelajaran, penggalangan dana, dan informasi pekerjaan. Hanya sekedar untuk perbaikan membangun jejaring saja.', 'Standar 3.3.1.b BAN PT', 'OB', 'Belum diintensifkan pemanfaatan group FB secara optimal.', 'Data yang tersaji tidak lengkap', 'Sebaiknya dibuat status di fb untuk mendapatkan opini alumni terkait dengan pendapat alumni mengenai proses pembelajaran yang mereka alami selama kuliah.\r\n- Menginformasikan ke group tentang informasi pekerjaan.\r\n- kemudian melakukan penggalangan dana oleh alumni untuk even-even tertentu.', 'Setuju', 'Memanfaatkan group alumni untuk perbaikan jurusan ke depan.', '2015-11-09', 'Ketua Prodi', 0, 16, '2015-09-28 21:50:00', 16, '2015-09-28 15:45:38', 0),
(189, 2, 25, 71, 'Data profil alumni dalam masa tunggu kerja pertama tidak ada.', 'Standar 3.3.2 BAN PT', 'OB', 'Belum dimuat pada formulir pelacakan alumni mengenai kolom masa tunggu kerja pertama kali.', 'Jurusan tidak mendapatkan informasi mengenai seberapa besar daya serap dunia kerja terhadap program studinya.', 'Dimasukkan kolom \"masa tunggu kerja\" pertama pada formulir website/group FB alumni.', 'Setuju', 'Menambahkan kolom \"masa tunggu kerja\" pertama pada website/group FB alumni', '2015-11-09', 'Ketua Prodi', 0, 16, '2015-09-28 22:53:13', 16, '2015-09-28 16:24:20', 0),
(190, 2, 25, 72, 'Data mengenai kesesuaian bidang kerja alumni dengan bidang studi tidak ada.', 'Standar 3.3.3 BAN PT', 'OB', 'Belum dimuat pada formulir pelacakan alumni mengenai kolom \"bidang kerja\".', 'Jurusan tidak mendapatkan informasi mengenai apakah alumninya bekerja sesuai dengan bidang keilmuannya.', 'Dimasukkan kolom \"bidang kerja\" pada formulir website/group FB alumni.', 'Setuju', 'Menambahkan kolom \"bidang kerja\" pada formulir website/group FB alumni.', '2015-11-09', 'Ketua Prodi', 0, 16, '2015-09-28 23:11:00', 16, '2015-09-28 16:22:57', 0),
(191, 2, 25, 73, 'Belum ada partisipasi alumni dalam mendukung pengembangan akademik program studi dalam bentuk :                 \r\n- Sumbangan dana\r\n- Sumbangan fasilitas\r\n- Penyediaan fasilitas untuk kegiatan akademik\r\n\r\n', 'Standar 3.4.1 BAN PT', 'OB', '- Alumni belum mapan secara finansial\r\n- Alumni belum terlacak secara komprehensif.', 'Jurusan tidak mendapatkan dukungan dana dari alumninya.', 'Meminta partisipasi  alumni dalam mendukung pengembangan akademik program studi pada saat mapan secara karir maupun finansial', 'Setuju', 'Mensosialisasikan group alumni pada saat yudisium dan meminta partisipasinya kelak pada saat sudah mapan.', '2015-11-09', 'Ketua Prodi', 0, 16, '2015-09-28 23:24:55', 16, '2015-09-28 17:11:46', 0),
