(194, 2, 25, 74, 'Belum ada partisipasi lulusan dan alumni dalam mendukung pengembangan non akademik program studi dalam bentuk :\r\n- Sumbangan dana\r\n- Sumbangan Fasilitas\r\n- Keterlibatan dalam bidang akademik \r\n- Penyediaan fasilitas untuk akademik', 'Standar 3.4.2 BAN PT', 'OB', '- Alumni belum mapan secara finansial\r\n- Alumni belum terlacak secara komprehensif', 'Jurusan tidak mendapatkan dana dari alumninya.', 'Meminta partisipasi alumni dalam mendukung pengembangan non akademik program studi pada saat mapan secara karir maupun finansial.', 'Setuju', 'Mensosialisasikan group alumni pada saat yudisium  dan meminta partisipasinya kelak pada saat sudah mapan.', '2015-11-09', 'Ketua Prodi', 0, 16, '2015-09-28 23:47:35', 16, '2015-09-28 17:10:57', 0),
(195, 2, 19, 59, 'Menurut SK Dikti No: Dj.I/362/2009 tertanggal 30 Juni 2009 dengan masa berlaku 5 tahun tentang izin penyelenggaraan prodi, maka izin penyelenggaraan Prodi Ekonomi Syariah dikatakan telah habis.', 'Standar Borang akreditasi BAN-PT.', 'KTS', 'Masa berlaku izin penyelenggaraan prodi tidak dicek.', 'Jika izin penyelenggaraan tidak diperpanjang, maka bisa kemungkinan prodi tersebut ditutup.', 'Ketua Jurusan akan segera membahas dalam rapat pimpinan dan mengusulkan untuk segera diperpanjang izin penyelenggaraan prodi.', 'Setuju', 'Membahas dalam rapat pimpinan.', '2016-02-15', 'Ketua Prodi', 0, 166, '2015-09-28 23:52:11', 166, '2015-09-28 16:56:54', 0),
