(197, 2, 19, 101, 'Syarat munaqasyah TOEFL min. 400 untuk S1, 450 untuk S2 dan 475 untuk S3 belum dilaksanakan di Prodi Ekonomi Syariah.', 'Panduan akademik dan peraturan akademik.', 'KTS', 'Di Prodi Ekonomi Syariah hanya menerapkan sertifikat lulus program bahasa dengan 3 level sebagai syarat munaqasyah.', 'Tidak ada persyaratan munaqasyah terkait skor TOEFL', 'Perlu dibahas dalam rapat pimpinan untuk menerapkan syarat munaqasyah ini dengan segera, karena syarat munaqasyah ini ada dalam peraturan akademik.', 'Setuju', 'Membahas dalam rapat pimpinan.', '2016-02-15', 'Ketua Prodi', 0, 166, '2015-09-28 23:59:18', 166, '2015-09-28 17:09:03', 0),
(198, 2, 19, 102, 'Syarat munaqasyah TOAFL min. 350 untuk S1, 400 untuk S2 dan 450 untuk S3 belum dilaksanakan di Prodi Ekonomi Syariah.', 'Panduan akademik dan peraturan akademik.', 'KTS', 'Di Prodi Ekonomi Syariah hanya menerapkan sertifikat lulus program bahasa dengan 3 level sebagai syarat munaqasyah.', 'Tidak ada persyaratan munaqasyah terkait skor TOAFL.', 'Perlu dibahas dalam rapat pimpinan untuk menerapkan syarat munaqasyah ini dengan segera, karena syarat munaqasyah ini ada dalam peraturan akademik.', 'Setuju', 'Membahas dalam rapat pimpinan.', '2016-02-15', 'Ketua Prodi', 0, 166, '2015-09-29 00:10:39', 166, '2015-09-28 17:12:46', 0),
(199, 2, 19, 106, 'Beban studi untuk Prodi Ekonomi Syariah sudah memenuhi standar yaitu 145 sks, namun Prodi Ekonomi Syariah belum menggunakan kurikulum KKNI.', 'Panduan akademik dan peraturan akademik.', 'KTS', 'Prodi Ekonomi Syariah belum mereview kurikulum yang sesuai dengan standar kurikulum nasional yaitu kurikulum KKNI.', 'Kurikulum yang digunakan tidak sesuai dengan kurikulum KKNI.', 'Segera melakukan review kurikulum yaitu kurikulum KKNI.', 'Setuju', 'Membahas dalam rapat pimpinan.', '2016-02-15', 'Ketua Prodi', 0, 166, '2015-09-29 00:13:51', 166, '2015-09-28 17:18:03', 0),
(200, 2, 25, 116, 'Dosen S3 hanya 2 orang', 'Standar 4.3.1.b BAN PT', 'KTS', 'Dosen belum mendaftarkan diri untuk melanjutkan pendidikan ke jenjang S3', 'Belum bisa membuka program S2', 'Memotivasi dosen untuk melanjutkan studi ke jenjang S3.', 'Setuju', 'Memotivasi dosen pada saat even-even pertemuan dosen untuk melanjutkan ke jenjang S3', '2015-02-08', 'Ketua Prodi', 0, 16, '2015-09-29 00:24:05', 16, '2015-09-29 11:13:04', 0),
(201, 2, 19, 116, 'Dosen tetap yang berpendidikan S3 yang bidang keahliannya sesuai dengan kompetensi prodi hanya 33,3%.', 'Standar borang akreditasi.', 'KTS', 'Kurangnya beasiswa untuk S3.', 'Belum tercapai standar borang akreditasi untuk persentase dosen tetap yang S3 yaitu >40%. Hal ini mengakibatkan nilai akreditasi pada standar sumber daya manusia jadi rendah.', 'Segera mengusulkan untuk memperbanyak beasiswa untuk S3.', 'Setuju', 'Membahas dalam rapat pimpinan tentang perbanyak beasiswa S3.', '2016-02-15', 'Ketua Prodi', 0, 166, '2015-09-29 00:24:46', 166, '2015-09-28 17:31:09', 0),
(202, 2, 25, 117, 'Dosen yang memiliki jabatan lektor kepala baru 2 orang, dan belum memiliki guru besar.', 'Standar 4.3.1.c BAN PT', 'KTS', '\r\n- Dosen tidak mengetahui dan Sulit mencari jurnal internasional untuk menerbitkan karya ilmiah', 'Terbatasnya jumlah dosen yang memiliki jabatan lektor kepala', '-  Mengiatkan dosen untuk terus berkarya, dan  menerbitkan karyanya pada jurnal internasional.\r\n- Aktif dalam pertemuan Ilmiah. \r\n- Untuk dosen S3 diminta agar menyiapkan diri untuk memenuhi syarat-syarat yang dibutuhkan untuk pengusulan promosi guru besar.', 'Setuju', 'Mengiatkan dosen untuk terus berkarya dan menerbitkan karyanya di jurnal internasional', '2015-02-08', 'Ketua Prodi', 0, 16, '2015-09-29 00:30:46', 16, '2015-09-29 11:12:15', 0),
(203, 2, 19, 117, 'Dosen tetap dengan jabatan fungsional lektor kepala dan guru besar hanya 33,3%.', 'Standar borang akreditasi.', 'KTS', 'Syarat untuk lektor kepala harus S3 atau boleh S2 namun harus punya jurnal terakreditasi atau internasional.', 'Tidak tercapai standar sumber daya manusia di borang akreditasi.', 'Segera membuat makalah yang diterbitkan di jurnal terakreditasi atau jurnal internasional.', 'Setuju', 'Membahas dalam rapat pimpinan.', '2016-02-15', 'Ketua Prodi', 0, 166, '2015-09-29 00:31:19', 166, '2015-09-28 17:34:33', 0),
(204, 2, 24, 119, 'Ada beberapa mata kuliah diajar oleh dosen yang sesuai keahliannya (pendidikan terakhir)', 'BAN-PT Standar 4.3.4 & 4.3.5  Kesesuaian keahlian (pendidikan terakhir) dosen dengan mata kuliah yang diajarkannya', 'OB', 'Prodi belum melaksanakan', 'Menurunkan kompetensi program studi', 'Dekan menginstruksikan prodi segera menyesuaikan pemberian mata kuliah berdasarkan pendidikan terakhir dosen', 'Setuju', 'Prodi merevisi  SK BAD untuk semua mata kuliah agar diampu oleh  dosen yang sesuai keahliannya (pendidikan terakhir)', '2016-06-01', 'Ketua Prodi', 0, 12, '2015-09-29 00:32:23', 12, '2015-09-29 07:00:24', 0);
