(299, 5, 21, 3, 'Jurusan belum memiliki SOP', 'STANDAR 2.3 BAN-PT', 'OB', 'Penerapan organizing yang belum terlaksana terutama dalam hal merumuskan SOP .', 'Menyulitkan dalam melakukan fungsi pengawasan, karena belum ada standar yang dapat dijadikan alat untuk mengukur tingkat pencapaian tujuan.', 'Jurusan mengajukan permohonan kepada Wakil Dekan I, untuk duduk bersama merumuskan pembuatan SOP. ', 'Setuju', 'Akan membuat SOP ke depannya dengan pimpinan secara bersama-sama.', '2017-01-02', 'Ketua Prodi', 0, 16, '2016-11-22 12:04:07', 16, '2016-11-23 15:58:24', 0),
(300, 5, 21, 8, 'Data mahasiswa baru reguler yang melakukan registrasi dan data calon mahasiswa baru reguler yang lulus seleksi tidak diketahui jurusan jumlahnya.', 'STANDAR 3.1.1.2 BAN-PT', 'OB', 'Pihak akademik rektorat tidak memberikan data ke fakultas.', 'Pihak jurusan tidak mengetahui secara rinci mengenai data mahasiswa baru reguler yang melakukan registrasi dan data calon mahasiswa baru reguler yang lulus seleksi.', 'Berkoordinasi dengan pihak akademik rektorat untuk mendapatkan data mahasiswa baru reguler yang melakukan registrasi dan data calon mahasiswa baru reguler yang lulus seleksi.', 'Setuju', 'Meminta data ke akademik rektorat mengenai mahasiswa baru reguler yang melakukan registrasi dan mahasiswa baru reguler yang lulus seleksi.', '2017-02-02', 'Ketua Prodi', 0, 16, '2016-11-22 12:42:23', 16, '2016-11-22 23:32:52', 0),
(301, 5, 21, 7, 'Data calon mahasiswa yang ikut seleksi tidak diketahui jurusan jumlahnya. Adapun daya tampung jurusan ini sebanyak 20 mahasiswa, namun dalam kenyataannya jumlah calon mahasiswa yang diterima sebagai mahasiswa berjumlah 120 orang.', 'STANDAR 3.1.1.1 BAN-PT', 'OB', 'Pihak akademik rektorat tidak memberikan data ke pihak jurusan mengenai calon mahasiswa yang ikut calon seleksi, serta tidak berjalannya fungsi coordinating antara pihak penerima calon mahasiswa dengan pihak jurusan/fakultas.', 'Pihak jurusan tidak mengetahui seberapa besar minat masyarakat terhadap jurusannya. Lalu, pihak jurusan tidak mengetahui perubahan ditambahnya daya tampung mahasiswa oleh pihak pimpinan universitas.', 'Berkoordinasi dengan pihak akademik rektorat untuk mendapatkan data calon mahasiswa yang ikut seleksi. Dan berkoordinasi dengan pihak pimpinan universitas terkait dengan kuota daya tampung, agar ke depannya tidak merubah kuota daya tampung secara sepihak.', 'Setuju', 'Meminta data kepada akademik rektorat. dan bertemu dengan pimpinan universitas untuk membicarakan kapasitas daya tampung jurusan.', '2017-02-02', 'Ketua Prodi', 0, 16, '2016-11-22 12:57:47', 16, '2016-11-23 00:01:27', 0),
(302, 5, 21, 10, 'Prestasi yang diraih mahasiswa hanya dibidang olahraga dan seni pada tingkat lokal, sedangkan olahraga dan seni pada tingkat wilayah, nasinal, dan internasional belum ada. Sementara  di bidang lomba ilmiah belum ada sama sekali.', 'STANDAR 3.1.2 BAN-PT', 'OB', 'Kurangnya minat mahasiswa, dan pembinaan yang belum optimal ditingkat fakultas.', 'Tidak ada prestasi mahasiswa dibidang olahraga dan seni ditingkat wilayah, nasional dan internasional. Begitu juga pada lomba karya ilmiah tidak ada prestasi yang dihasilkan oleh mahasiswa baik ditingkat lokal, wilayah, nasional, dan internasional.', 'Memotivasi dan menggiatkan mahasiswa untuk berpartisipasi dalam kegiatan lomba ilmiah, lebih meningkatkan lagi perlombaan olahraga dan seni pada tingkat wilayah, nasional, dan internasional.', 'Setuju', 'Memotivasi mahasiswa pada saat kuliah umum dan  pada saat ada pertemuan-pertemuan jurusan dengan mahasiswa.', '2017-02-13', 'Ketua Prodi', 0, 16, '2016-11-22 13:49:38', 16, '2016-11-23 15:39:38', 0),
(303, 5, 21, 14, 'Data lulusan dan alumni tidak terlacak dan terekam secara terorganisir.', 'STANDAR 3.4.1.1 BAN-PT', 'OB', 'Jurusan tidak mengetahui bahwasanya bagian kemahasiswaan rektorat memiliki website pengelolaan alumni. Selain itu fakultas juga tidak memasukkan data alumni pada website fakultas.', 'Jurusan tidak mensosialisasikan kepada alumninya untuk mengisi formulir yang terdapat di website : alumni.uin-suska.ac.id. Selain itu jurusan juga tidak dapat mengetahui data tentang alumninya.', 'Jurusan menyampaikan kepada lulusan dan alumni untuk mengisi formulir pada website alumni.uin-suska.ac.id. Selain itu, fakultas juga bisa mengelola data alumninya melalui website milik fakultas.', 'Setuju', 'Akan mensosialisasikan website alumni kepada mahasiswa pada saat acara pelepasan wisudawan. Dan memasukkan data alumni dalam website fakultas', '2017-03-06', 'Ketua Prodi', 0, 16, '2016-11-22 14:33:03', 16, '2016-11-23 15:48:16', 0),
(304, 5, 21, 15, 'Penggunaan pelacakan alumni untuk perbaikan jurusan dengan memanfaatkan alumni belum dapat dilakukan.', 'STANDAR 3.4.1.1 BAN-PT', 'OB', 'Jurusan tidak mengetahui bahwa ada formulir yang harus diisi oleh para alumni pada website alumni yang dikelola bagian kemahasiswaan rektorat. Sebab lainnya jurusan tidak memanfaatkan IT dalam mengelola alumninya.', 'Perbaikan untuk proses pembelajaran, penggalangan dana, informasi pekerjaan, membangun jejaring, tidak bisa dimanfaatkan secara efektif.', 'Data alumni harus dikelola dengan baik dengan memanfaatkan IT, dengan cara bisa bekerjasama dengan bagian kemahasiswaan rektorat atau jurusan/fakultas mengelola sendiri pada websitenya terkait data alumni.', 'Setuju', 'Berkoordinasi dengan bagian kemahasiswaan rektorat. Alternatif lainnya jurusan meminta fakultas mengelola data alumninya sendiri.', '2017-07-03', 'Ketua Prodi', 0, 16, '2016-11-22 15:09:24', 16, '2016-11-23 00:16:30', 0),
(305, 5, 21, 16, 'Masa tunggu kerja pertama alumni tidak terlacak.', 'STANDAR 3.4.3 BAN-PT', 'OB', 'Jurusan tidak  mengelola alumninya dengan memanfaatkan IT.', 'Jurusan tidak mengetahui seberapa lama alumninya menunggu kerja pertama kalinya', 'Jurusan berkoordinasi dengan pihak kemahasiswaan rektorat. Cara lain, memasukkan data alumni pada website fakultas tentang data alumninya.', 'Setuju', 'Berkoordinasi dengan bagian kemahasiswaan rektorat atau menambahkan data alumni pada website fakultas.', '2017-07-03', 'Ketua Prodi', 0, 16, '2016-11-22 15:26:12', 16, '2016-11-23 16:02:52', 0),
(306, 5, 21, 17, 'Tidak ditemukannya data mengenai kesesuaian bidang kerja dengan bidang studi.', 'STANDAR 3.4.4 BAN-PT', 'OB', 'Jurusan tidak mendata tentang bidang kerja apa saja yang telah digeluti oleh alumninya.', 'Jurusan tidak dapat mengetahui apakah kurikulum sekarang ini masih relevan dengan kebutuhan dunia kerja.', 'Melacak bidang-bidang kerja para alumni, agar dapat digunakan sebagai bahan evaluasi terhadap kurikulum sekarang ini dengan kebutuhan dunia kerja.', 'Setuju', 'menambahkan poin \"bekerja pada bidang\" pada website alumni.', '2017-07-03', 'Ketua Prodi', 0, 16, '2016-11-22 20:59:12', 16, '2016-11-23 00:23:56', 0),
(307, 5, 21, 18, 'partisipasi alumni baru pada tahap membangun jejaring saja, belum sampai pada tingkat partisipasi memberikan sumbangan dana, sumbangan fasilitas, masukan untuk perbaikan proses perbaikan yang berkaitan dengan pengembangan akademik jurusan.', 'STANDAR 3.5 BAN-PT', 'OB', 'Alumni belum terlacak secara komprehensif.', 'Tidak didapatkannya partisipasi alumni dalam pengembangan akademik jurusan.', 'Melacak keberadaan alumni, kemudian meminta partisipasi mereka pada pengembangan akademik jurusan.', 'Setuju', 'Membuat website alumni. Dimana kemudian hari dapat digunakan untuk mendapatkan partisipasi alumni dalam pengembangan akademik jurusan.', '2017-08-07', 'Ketua Prodi', 0, 16, '2016-11-22 21:23:53', 16, '2016-11-23 00:25:59', 0),
(308, 5, 21, 19, 'Belum ada partisipasi alumni dalam mendukung pengembangan non akademik program studi dalam bentuk sumbangan dana, sumbangan fasilitas, masukan untuk perbaikan proses pembelajaran.', 'STANDAR 3.5 BAN-PT', 'OB', 'Data alumni belum terlacak.', 'Tidak dapat dimanfaatkan partisipasi alumni pada pengembangan non akademik.', 'Mensosialisasikan kepada alumni dan lulusan supaya mengisi wbsite alumni yang dikelola bagian kemahasiswaan rektorat. Selain itu dapat juga dengan memasukkan data alumni pada website yang dikelola fakultas sehingga dapat melacak keberadaan alumni. dimana pada suatu saat dapat digunakan untuk meminta partisipasi mereka untuk pengembangan non akademik jurusan.', 'Setuju', 'Memasukkan data alumni ke  website fakultas.', '2017-08-07', 'Ketua Prodi', 0, 16, '2016-11-22 21:38:28', 16, '2016-11-23 07:20:44', 0),
(309, 5, 21, 23, 'Jurusan tidak membuat berita acara perkuliahan.', 'Proses pembelajaran UIN', 'OB', 'Tidak ada instruksi dari pimpinan.', 'Tidak dapat diketahui sejauh mana proses pembelajaran yang dilakukan dosen dikelas.', 'Membuat berita acara perkuliahan dan menugaskan tenaga kependidikan menjalankan administrasinya.', 'Setuju', 'Jurusan mengusulkan kepada pimpinan untuk membuat berita acara perkuliahan', '2017-02-06', 'Ketua Prodi', 0, 16, '2016-11-22 21:45:12', 16, '2016-11-22 23:21:40', 0),
(310, 5, 21, 35, 'Jurusan sudah pernah melakukan pertemuan dengan asosiasi perbankan syariah diseluruh Indonesia. Oleh karena  pada saat itu asosiasi ini masih pada tahap pembentukan maka belum ada membicarakan tentang kurikulum inti perbankan syariah.', 'Kurikulum dan suasana akademik UIN', 'OB', 'Asosiasi ini masih baru.', 'Belum didapatkan kurikulum inti yang disepakati bersama berdasarkan konsorsium.', 'Jurusan merancang terlaksananya konsorsium yang membahas tentang kurikulum inti perbankan syariah. Atau  pimpinan mengutus jurusan untuk menghadiri konsorsium yang diselenggarakan perguruan tinggi lain.', 'Setuju', 'Merembukkan dengan anggota asosiasi,kapan dilakukan pertemuan jurusan perbankan syariah untuk periode berikutnya.', '2017-09-15', 'Ketua Prodi', 0, 16, '2016-11-22 21:52:58', 16, '2016-11-23 00:36:53', 0),
(311, 5, 21, 43, 'Bobot SKS PKL yang dilaksanakan oleh jurusan 4 SKS, sedangkan yang ditetapkan UIN 3 SKS', 'Kurikulum UIN', 'OB', 'Jurusan mengunakan hasil review 2015.', 'Beban SKS yang ditetapkan jurusan tidak cocok dengan kurikulum yang ditetapkan UIN.', 'Jurusan berkoordinasi dengan pimpinan universitas untuk membicarakan bobot SKS PKL.', 'Setuju', 'Berkoordinasi dengan pimpinan universitas untuk membahas bobot SKS PKL', '2017-05-02', 'Ketua Prodi', 0, 16, '2016-11-22 22:11:15', 16, '2016-11-23 00:41:11', 0),
(312, 5, 21, 46, 'Program bahasa yang dilaksanakan jurusan selama 3 semester, sedangkan yang ditetapkan UIN 2 semester.', 'Kurikulum UIN', 'OB', 'Jurusan melaksanakan sesuai dengan hasil review kurikulum 2015', 'Tidak cocok dengan yang ditetapkan oleh UIN.', 'Jurusan berkoordinasi dengan pihak pimpinan universitas untuk menyamakan persepsi terkait dengan program bahasa.', 'Setuju', 'Berkoordinasi dengan pihak pimpinan universitas Jurusan juga akan menyampaikan jika terjadi perubahan terkait dengan proses akademik meminta pimpinan untuk memberikan instruksi secara tertulis kepada jurusan.', '2017-01-02', 'Ketua Prodi', 0, 16, '2016-11-22 22:17:41', 16, '2016-11-23 16:09:29', 0),
(313, 5, 21, 47, 'Mahasiswa yang telah memiliki sertifikat pada lembaga penyelelenggara bahasa dari luar UIN (Lembaga-lembaga kursus), tetap wajib mengikuti program bahasa di UIN.', 'Kurikulum UIN', 'OB', 'Tidak ada sosialisasi tentang ketentuan bahwa bagi mahasiswa yang telah memiliki sertifikat pada level-level tertentu, tidak wajib mengikuti program bahasa pada level itu.', 'Mahasiswa yang telah memiliki sertifikat tetap mengikuti perkuliahan.', 'Jurusan berkoordinasi dengan lembaga pusat bahasa mengenai apakah mahasiswa yang sudah memiliki sertifikat pada level tertentu tidak perlu mengikuti kuliah bahasa lagi sesuai level yang ada disertifikat.', 'Setuju', 'Jurusan berkoordinasi dengan lembaga pusat bahasa mengenai apakah mahasiswa yang sudah memiliki sertifikat pada level tertentu tidak perlu mengikuti kuliah bahasa lagi sesuai level yang ada disertifikat.', '2017-01-02', 'Ketua Prodi', 0, 16, '2016-11-22 22:30:41', 16, '2016-11-23 15:57:01', 0),
(314, 5, 21, 58, 'Pada kegiatan praktikum, dosen pengampu tidak membuat diari kerja, yang ada hanya modul dan bahan ajar.', 'Kurikulum UIN', 'OB', 'Belum ada instruksi dari pimpinan  untuk membuat diari kerja.', 'Kegiatan yang dilakukan tidak terdokumentasi dengan baik, sehingga tidak dapat dipantau apa-apa saja kegiatan yang dilaksanakan dalam praktikum.', 'Menginstruksikan kepada dosen untuk membuat diari kerja pada saat praktikum dan mendokumentasikannya dalam bentuk tertulis.', 'Setuju', 'Berkoordinasikan dengan dosen pengampu mata kuliah praktikum agar mereka membuat diari kerja.', '2017-01-09', 'Ketua Prodi', 0, 16, '2016-11-22 22:52:25', 16, '2016-11-22 23:27:03', 0),
