(333, 6, 9, 116, 'Dosen Tetap yang berpendidikan S.3 yang bidang keahliannya sesuai dengan kompetensi Program Studi  kurang dari  40 %.', 'Standar  BAN - PT', 'KTS', '1. Biaya Kuliah dan biaya hidup selama studi  S.3 relatif mahal.\r\n2. Kesempatan memperoleh bantuan beasiswa pendidikan terbatas.', '1. Nilai akreditasi Prodi / Universitas kurang  maksimal.\r\n2. Kompetensi mahasiswa / alumni kurang berkembang  secara optimal.', '1. Ka. Prodi / Dekan Membuat perencanaan dan target pencapaian jumlah (rasio) Dosen S.3 yang sesuai bidang keahliannya secara periodik dan mengacu pada standar BAN-PT.\r\n2. Pimpinan Perguruan Tinggi memfasilitasi  percepatan  (sesuai prosedur) terbitnya surat ijin belajar atau tugas belajar dosen S.3. \r\n3. Pimpinan Perguruan Tinggi  membuat pola kebijakan pemberian bantuan biaya pendidikan kepada Dosen yang S.3 dengan biaya sendiri. \r\n4. Pimpinan Perguruan Tinggi melakukan / meningkatkan  kerjasama dengan berbagai pihak  sponsor  bantuan dana pendidikan S.3.', 'setuju', 'TA. 2017/2018 sampai dengan  TA. 2019/2020', '2016-11-24', 'Ketua Prodi: Drs. HM. Syafi\'i S., M.Pd', 1, 33, '2016-11-24 08:10:42', 33, '2016-11-25 09:07:10', 0),
(334, 6, 9, 117, 'Dosen Tetap yang memiliki jabatan Lektor Kepala dan Guru Besar yang bidang keahliannya sesuai dengan kompetensi  Program Studi  kurang dari  40%.', 'Standar BAN - PT', 'KTS', 'Persyaratan menduduki jabatan Lektor Kepala : (Pendidikan S.3 atau Jurnal Internasional).', 'Nilai akreditasi Prodi / Universitas tidak maksimal.', '1. Pimpinan Perguruan Tinggi  secara sistemik dan prosedural mendorong percepatan kenaikan pangkat dosen. \r\n2. Pimpinan Fakultas/ Universitas mendorong dan memfasilitasi percepatan  ijin belajar / tugas belajar  S.3 Dosen  serta mengupayakan bantuan biaya pendidikan S.3 dari berbagai pihak.\r\n 3. Fakultas / Universitas berlangganan Jurnal Internasional.  \r\n4. Training keterampilan menulis di jurnal internasional.', 'Setuju', 'TA. 2017/2018  sampai  TA. 2019/2020', '2016-11-24', 'Ketua Prodi: Drs. HM. Syafi\'i,S. M.Pd', 1, 33, '2016-11-24 08:18:06', 33, '2016-11-25 09:16:40', 0),
(335, 6, 22, 62, 'jurusan tidak memiliki data seleksi calon mahasiswa prodi', 'Mahasiswa dan BAN PT', 'OB', 'Data proses seleksi calon mahasiswa tidak ada di prodi. Pihak rektorat tidak memberikannya kepada prodi', 'Prodi tidak memiliki data proses seleksi calon mahasiswa', 'Prodi meminta data ke rektorat dan mengarsipkannya setiap tahun', 'siap melaksanakannya', 'segera meminta ke rektorat', '2017-06-01', 'Ketua Prodi', 0, 19, '2016-11-24 09:36:36', 19, '2016-11-25 03:56:14', 0),
