(397, 6, 26, 62, 'Rasio calon mahasiswa yang ikut seleksi : daya tampung < 5', 'Manual Mutu', 'KTS', '- Persaingan dengan Prodi Umum\r\n- Tidak tersosialisasi dengan baik prospek  lulusan di dunia kerja', 'Rasio calon mahasiswa dengan daya tampung adalah 1:3 belum sesuai standar UIN', 'Sosialisasi perlu ditingkatkan baik dari sisi kulitas dan kuantitas dengan memunculkan strategi sosialisai yang tepat', 'Setuju', '- Untuk ukuran Jurusan Agama rasio tersebut sebenarnya sudah cukup baik, kemungkinan masalah prospek dengan persaingan dengan jurusan umum\r\n- Sosialisasi yang sudah pernah dilakukan terutama dalam tahun ini (acara milad dan pengabdian masyarakat) dirasa cukup memberikan hasil yang signifikan terbukti dengan meningkatnya jumlah peminat. \r\nUntuk kedepannya memang akan dilaksanakan sosialisasi sesegera mungkin dengan berbagai kegiatan seperti  acara milad, sosialisasi ke daerah-daerah, ke sekolah-sekolah ataupun dalam bentuk kegiatan pengabdian masyarakat', '2017-11-30', 'Ketua Prodi', 0, 46, '2016-11-29 13:29:17', 46, '2016-11-29 13:38:40', 0),
